                color: #485fc7;
                font-weight: bold;
            }
        </style>
    </head>
    <body>
        <div class="container is-max-desktop">
            <section class="section">
                <h1 class="title">Are you a dog?</h1>
                <p class="subtitle">Or are you a human?</p>
                <div class="field has-addons">
                    <div class="control">
                        <input class="input" type="text" placeholder="Enter a name" aria-label="name input">
                    </div>
                    <div class="control">
                        <button class="button is-info">Search</button>
                    </div>
                </div>
                <div id="recs" style="display: none;">
                    <ul></ul>
                </div>
            </section>
            <section class="section">
                <h2 id="name" class="title is-4"></h2>
                <div class="block">
                    This name is 
                    <span id="percent"></span>%
                    likely to be a human name. If you gathered 100,000 dogs and 100,000 humans, 
                    <span id="dogs"></span> 
                    dogs would have this name and 
                    <span id="humans"></span> 
                    humans would have this name.
                </div>
                <div class="level">
                    <div class="level-left">
                        <div class="level-item">
                            <p>Dog</p>
                        </div>
                    </div>
                    <div class="level-item">
                        <progress class="progress is-link" value="0"></progress>
                    </div>
                    <div class="level-right">
                        <div class="level-item">
                            <p>Human</p>
                        </div>
                    </div>
                </div>
            </section>
        </div>
        <script type="text/javascript">
            data.sort((a, b) => a.n.localeCompare(b.n));
            const names = data.map(stat => stat.n);
            const lnames = names.map(name => name.toLowerCase());

            let index = -1;

            const nameHead = document.getElementById('name');
            const percent = document.getElementById('percent');
            const dogs = document.getElementById('dogs');
            const humans = document.getElementById('humans');
            const progress = document.getElementsByTagName('progress')[0];
            const showResults = (name) => {
                name = name.trim().toLowerCase();
                const stat = data.find(stat => stat.n.toLowerCase() === name);
                if (!stat) return;
                recsPopup.style.display = 'none';
                nameHead.innerText = stat.n;
                percent.innerText = (stat.s * 100).toString().substring(0, 5);
                dogs.innerText = stat.d;
                humans.innerText = stat.h;
                progress.value = stat.s;
            };

            const recsPopup = document.getElementById('recs');
            const recsList = document.getElementsByTagName('ul')[0];
            const input = document.getElementsByTagName('input')[0];
            input.addEventListener('input', ({ target }) => {
                const search = target.value.toLowerCase();
                const recs = [];
                if (search) {
                    for (let i = 0; i < lnames.length; i++) {
                        if (recs.length >= 7) break;
                        if (lnames[i].includes(search)) recs.push(names[i]);
                    }
                }
                if (recs.length >= index) index = -1;
                recsList.innerHTML = "";
                recsPopup.style.display = recs.length ? 'block' : 'none';
                recs.forEach(rec => {
                    const li = document.createElement('LI');
                    li.innerText = rec;
                    li.addEventListener('click', ({ target }) => showResults(target.innerText));
                    recsList.append(li);
                });
            });
            input.addEventListener('keydown', (event) => {
                switch(event.key) {
                    case "Enter":
                        if (index === -1)
                            return showResults(event.target.value);
                        if (index < 0 || index >= recsList.children.length) return;
                        event.preventDefault();
                        showResults(recsList.children[index].innerText);
                        break;
                    case "ArrowDown":
                        if (index < -1 || index >= recsList.children.length) return index = -1;
                        event.preventDefault();
                        if (index !== -1)
                            recsList.children[index].classList.remove('selected');
                        if (++index < recsList.children.length)
                            recsList.children[index].classList.add('selected');
                        else index = -1;
                        break;
                    case "ArrowUp":
                        if (index < -1 || index >= recsList.children.length) return index = -1;
                        event.preventDefault();
                        if (index !== -1)
                            recsList.children[index].classList.remove('selected');
                        else
                            index = recsList.children.length;
                        if (--index >= 0)
                            recsList.children[index].classList.add('selected');
                        break;
                    default:
                        break;
                }
            });

            showResults('brick');
        </script>
    </body>
</html>
